import React, { Component } from 'react'
import { Row, Col } from 'antd'
import { FormOutlined, LeftOutlined, RightOutlined } from '@ant-design/icons';

export default class QjMail extends Component {
    render() {
        return (
            <div>
                <Row>
                    <Col className="station-master-mail" span={6}>
                    站长邮箱
                    </Col>
                    <Col span={6}>2</Col>
                    <Col span={6}>3</Col>
                    <Col span={6}>4</Col>
                </Row>
            </div>
        )
    }
}
